export const timeChange = (time) => {
    return{
        type:'TIME',
        payload:time
    }
}

export const getData =() => {
    fetch(`https://www.googleapis.com/blogger/v3/blogs/9085604028025620950/posts?key=AIzaSyChWrKyLjsVyYj42CKBstkjrOnKWwPLqDs`)
      .then(resp => resp.json()).then(data =>
          dispatch({
            type: "FETCH_DATA",
            payload: data.items
          })
        );
      };
